// App.js or index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import UserProvider from './UserProvider'; // Adjust the path

ReactDOM.render(
  <React.StrictMode>
    <UserProvider>
      <App />
    </UserProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
